CREATE TABLE `position_in_stream` (
  `position_in_stream_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Uinique identifiere',
  `sign_id` int(11) unsigned NOT NULL COMMENT 'References a sign',
  `previous_position` int(10) unsigned DEFAULT NULL,
  `next_position` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`position_in_stream_id`),
  KEY `fk_sign_stream_signs1_idx` (`sign_id`),
  KEY `fk_to_previous_idx` (`previous_position`),
  KEY `fk_to_next_idx` (`next_position`),
  CONSTRAINT `fk_to_next` FOREIGN KEY (`next_position`) REFERENCES `position_in_stream` (`position_in_stream_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_to_previous` FOREIGN KEY (`previous_position`) REFERENCES `position_in_stream` (`position_in_stream_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_to_sign` FOREIGN KEY (`sign_id`) REFERENCES `sign` (`sign_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=399 DEFAULT CHARSET=utf8 COMMENT='Put signs in one-dimensional stream (≈ text)\nThe reason for this table is, that the manuscripts may contain parallel text-streams created by corrections. Sometimes also scholars put superlinear signs at different places. Thus, this is a discrete layer of interpretation between signs and words.';


CREATE TABLE `position_in_stream_to_word_rel` (
