CREATE TABLE `real_area` (
  `real_area_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Unique identifier',
  `scroll_id` int(11) unsigned DEFAULT NULL COMMENT 'Reference to the master-image',
  `area_in_scroll` multipolygon DEFAULT NULL COMMENT 'Area on the virtual\nPOLYGON should give us the possibility to store the area according to the sign shape at least in a narrowing way, though it need not to be the actual exact shape of the sign',
  `rotation` decimal(6,3) NOT NULL DEFAULT '0.000' COMMENT 'The rotation in degrees to be applied to the image of the sign ',
  `owner_id` smallint(5) unsigned NOT NULL DEFAULT '0',
  `values_set` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'If true, then the are_in_scroll and rotation are set by the user and must not be affected by the automatic placing of the system',
  `position_in_scroll` point DEFAULT NULL,
  `z_index` tinyint(3) unsigned DEFAULT NULL,
  `line_of_scroll_id` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`real_area_id`),
  KEY `fk_to_scroll_idx` (`scroll_id`),
  KEY `fk_to_line_of_scroll_idx` (`line_of_scroll_id`),
  CONSTRAINT `fk_real_area_to_scroll` FOREIGN KEY (`scroll_id`) REFERENCES `scroll` (`scroll_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_to_line_of_scroll` FOREIGN KEY (`line_of_scroll_id`) REFERENCES `line_of_column_of_scroll` (`line_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Contains data to define a real space on a reference-image (a master-image, to which all other images are mapped)\n\nwe have to discuss the unique identifier of the reference image';


