CREATE TABLE `sign` (
  `sign_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Unique identifier',
  `date_of_adding` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `sign` char(1) NOT NULL DEFAULT '?' COMMENT 'the sign itself\\nspaces = text-space („ „) + _is_vacat=no\\nvacat = text-space + is_vacat=yes\\nthe logic is: we would like to distinguish between different width of spaces without to decide beforehand whether it is an intended vacat or not. ',
  `sign_type_id` tinyint(3) unsigned NOT NULL DEFAULT '1',
  `width` decimal(6,3) NOT NULL DEFAULT '1.000' COMMENT 'width in chars\\ncan also be used as a sloppy way to estimate the place used by the sign (especially when there are no font-information), which is handy if the sign is not yet related to a real area\\nFinally the value 255 marks a break with unknown width',
  `might_be_wider` tinyint(1) NOT NULL DEFAULT '0',
  `vocalization_id` tinyint(3) unsigned DEFAULT NULL,
  `readability` enum('COMPLETE','INCOMPLETE_BUT_CLEAR','INCOMPLETE_AND_NOT_CLEAR') DEFAULT NULL,
  `readable_areas` set('NW','NE','MW','ME','SW','SE') DEFAULT NULL COMMENT '2x4-field set to locate readable areas\ncan be used to set brackets in a more sophisticated way\n\nNW    NE\nMNW MNE\nMSW MSE\nSW    SE',
  `is_reconstructed` tinyint(1) NOT NULL DEFAULT '0',
  `is_retraced` tinyint(1) NOT NULL DEFAULT '0',
  `form_of_writing_id` int(11) unsigned NOT NULL DEFAULT '1',
  `editorial_flag` enum('NO','CONJECTURE','SHOULD_BE_ADDED','SHOULD_BE_DELETED') DEFAULT NULL,
  `commentary` text,
  `real_areas_id` int(11) unsigned DEFAULT NULL,
  `break_type` set('LINE_START','LINE_END','COLUMN_START','COLUMN_END') DEFAULT NULL,
  PRIMARY KEY (`sign_id`),
  KEY `char_idx` (`sign`),
  KEY `fk_sigs_to_chars_of_writing_idx` (`form_of_writing_id`),
  KEY `fk_signs_to_real_areas` (`real_areas_id`),
  KEY `sign_type_id_idx` (`sign_type_id`),
  CONSTRAINT `fk_signs_to_real_areas` FOREIGN KEY (`real_areas_id`) REFERENCES `real_area` (`real_area_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_to_sign_types` FOREIGN KEY (`sign_type_id`) REFERENCES `sign_type` (`sign_type_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=881 DEFAULT CHARSET=utf8 COMMENT='Contains a possible content for a given char place (char, space,vacat, meta-sign)';


