CREATE TABLE `SQE_image` (
  `sqe_image_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `url_code` int(10) unsigned NOT NULL DEFAULT '0',
  `filename` varchar(128) NOT NULL DEFAULT '',
  `native_width` int(10) unsigned NOT NULL,
  `native_height` int(10) unsigned NOT NULL,
  `dpi` int(10) unsigned NOT NULL,
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'Two values:\nColor = 0\nGrayscale = 1',
  `wavelength_start` smallint(5) unsigned NOT NULL DEFAULT '445',
  `wavelength_end` smallint(5) unsigned NOT NULL DEFAULT '704',
